import React from 'react';

const FiltreVoiture = ({ listeVoitures }) => {

    console.log(listeVoitures)

    return (
        <div className="FiltreVoiture">
            <form>
                <label htmlFor="Kilometrage">Kilométrage : {listeVoitures.km} km</label>
                <input
                    type="range"
                    name="readyInMinutes"
                    min="1"
                    max="120"
                    defaultValue={newRecette.readyInMinutes}
                    onChange={handleInputChange}
                />
            </form>

        </div>
    );
};

export default FiltreVoiture;
